/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "内置校验规则"
    }}>{`内置校验规则`}</h1>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`规则名`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`作用`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`入参`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`message默认值`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`required`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`必填`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`必填`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`number`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`数字`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`只能输入数字`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`int`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`正整数`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`只能输入正整数`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`uint`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非负整数`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`只能输入非负整数`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`length`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`长度`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(length: number, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`长度只能是\${length}个字符`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`minLength`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`最小长度`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(min: number, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`长度不能少于\${min}个字符`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`maxLength`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`最大长度`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(max: number, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`长度不能超过\${max}个字符`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`eq`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`相等`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(val: any, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`不传入会抛异常, 必须传入`}</strong></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`equal`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`相等于其他字段`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(field: string, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`不传入会抛异常, 必须传入`}</strong></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`min`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`最小值`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(min: number, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`不能小于\${min}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`max`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`最大值度`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(max: number, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`不能大于\${max}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`email`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`邮箱`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`邮箱格式不正确`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`url`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`url`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`链接格式不正确,请以 http:// 或者 https:// 开头`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`phone`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`固话`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`错误的电话格式`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`precision`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`精确到小数`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(precision: number, message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`必须精确到\${precision}位小数`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`alphabet`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`英文字母`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`只允许输入英文字母`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`words`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`英文字母和数字`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`只允许输入英文字母和数字`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ascii`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`英文字母标点和数字`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`只允许输入英文字母标点和数字`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`idCard`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`身份证号`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`请输入正确的身份证号`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`mobile`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`手机号码`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`请输入正确的手机号码`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`hsCode`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`HSCODE`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(message: string)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`请输入正确的HSCODE`}</td>
        </tr>
      </tbody>
    </table>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
